--
-- Name: V_ValueSetValueMapping; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public."V_ValueSetValueMapping" AS
 SELECT vssource."DataModelId" AS "SourceDataModelId",
    vsvsource."Value" AS "SourceValue",
    vstarget."DataModelId" AS "TargetDataModelId",
    vsvtarget."Value" AS "TargetValue",
    vsvm."Id",
    vsvm."SourceValueId",
    vsvm."TargetValueId",
    vsvm."Description",
    vsvm."UseConsiderations" AS "EquityConsiderations",
    vsvm."OriginalValueMappingId",
    vsvm."Notes",
    vsvm."CreationDate",
    vsvm."ActivationDate",
    vsvm."DeprecationDate",
    vsvm."Contributor",
    vsvm."ContributorOrganization"
   FROM ((((public."ValueSetValueMapping" vsvm
     JOIN public."ValueSetValues" vsvsource ON ((vsvsource."Id" = vsvm."SourceValueId")))
     JOIN public."ValueSetValues" vsvtarget ON ((vsvtarget."Id" = vsvm."TargetValueId")))
     JOIN public."ValueSets" vssource ON ((vssource."Id" = vsvsource."ValueSetId")))
     JOIN public."ValueSets" vstarget ON ((vstarget."Id" = vsvtarget."ValueSetId")));


