1293	Name	Person.Name	\N	In the treatment of a person name by the Learner Information Framework (LIF) and associated technologies, may users of LIF always center the human story of a person's name, how important it is to them, its cultural connectedness to people and land, how people traverse multiple ways of naming and the impact of naming on our stories, experiences and the opportunities it may connect (or disconnect) us to/from.   Using and treating data on people's names can raise several equity issues due to the diversity of naming conventions across cultures and ethnicities. Some of these equity issues include:\n1. Many of the data standards from which LIF draws its normative data model, and as to user of LIF, these systems are designed with Western naming conventions in mind, which can marginalize individuals with non-Western names. This bias can lead to inaccuracies in data analysis and decision-making processes. For example, we made recommendations for the separation of name and name type as well as inclusion of multiple characters, unlimited character length, etc). \n2. The variety of ways the standards treat person name shows limited interoperability between system-standards, which ultimately may lead to multiple records with different ways names are recorded, managed, and/or used. This Inaccurate or incomplete data due to mishandling of names can lead to biased analyses and decision-making, ultimately reinforcing existing disparities in society.\n3. Many of the standards, and the normative model, collapse name and name type into each other. Given the sensitivities and human implications for name changes, as well as the type of name (e.g., preferred, legal, given/gifted etc), we leant into AACRAO report on student identity for recommendations on how learners/students prefer to record and include their names.\n4. Most of the standards systems encourage the standardization of names, which can overlook variations in spelling, pronunciation, and order of names across different cultures. This can result in the erasure of cultural identities and misrepresentation of individuals.\n5. Most of the standards did not include an option for people from indigenous communities to record their Nation Tribe, or their name type as belong to their nation tribe. We leaned into research from the BIA.gov and recommend adding this to the normative model to improve inclusivity and cultural responsiveness to the naming conventions of our first nations peoples.  \n6. Collecting full names without proper consent or understanding of cultural sensitivities can infringe on individuals' privacy rights, especially in contexts where certain names may carry social or political implications. For example, having strict guardrails on when/how legal name vs. preferred name is used and who has access to the \n\nFor LIF purposes, our recommendation is that IF used in normative model, only names which have been consented to including/use by LIF, be included, with flexibility for their design and formatting to allow for cultural differences. \n\nTitle Suffix and prefix components of a persons name are used to provide additional information about a person's name. Using and treating data on people's titles can raise several equity issues.\n1. One argument for the inclusion of titles in normative data models is they may provide contextual information about an individual's identity and social status, and when used correctly, may ensure that individuals are addressed and identified appropriately, respects their social and professional distinctions.\n2. Traditional titles and honorifics often assume binary gender categories and may not adequately reflect the diversity of gender or social identities, may not be universally understood or used in all cultures or communities; and standardized forms may not accommodate all cultural or social variations in naming practices. For example, "Mr." for men and "Mrs." for married women. These assumptions about gender roles or marital status based on titles may not align with individuals' cultural norms or preferences. This binary classification can exclude and do harm to individuals who do not identify within these categories, such as non-binary or gender non-conforming individuals.\n3. Name suffixes, such as "Jr." or "III," can sometimes reveal familial relationships or generational information. Collecting this data without consent or proper safeguards may infringe on individuals' privacy rights and expose them to risks like identity theft or targeted advertising.\n4. Name suffixes may intersect with other aspects of an individual's identity, such as race, ethnicity, or gender. Failing to consider these intersections can perpetuate systemic inequalities and hinder efforts to promote equity and social justice.\n5. Different cultures may have specific titles or honorifics that hold significance and should be respected in data collection processes. Failing to accommodate these cultural variations can lead to erasure and marginalization of certain communities.\n6. Further, some individuals may not use titles, prefixes, or suffixes at all in their names, or they may have unconventional naming customs that are not recognized by standardized systems.\n6. Inaccurate or incomplete data on titles and prefixes can lead to biased analyses and decision-making, especially in contexts such as healthcare or academic research where precise demographic information is crucial. \n7. Failing to accommodate these variations of the use of titles, suffix, and/or prefix can marginalize certain groups and perpetuate cultural biases. \n\nFor LIF purposes, our recommendation is that if used in normative model, only titles, prefix and affix which have been consented to including/use, and which pertain to qualifications, credentials, work, learning, cultural significance and/or honorifics be included, with flexibility for their design and formatting to allow for cultural differences. Titles, prefix and suffix which pertain to social, generational, marital or gender status should not be included to not perpetuate inequalities and expose learner to harm.	1	entity	\N	No	Yes	\N	\N	\N	\N	\N	\N	LIF	f	\N	t	\N	\N	\N
