239	Address	Common.Contact.Address	\N	Using and treating data on someone's physical address, be it personal, home, work etc., can have significant equity implications, particularly concerning privacy, security, and socioeconomic disparities and especially for people from marginalized communities. \n\nLIF implementors need to be responsible in the ways we design and use data models to serve in the use and transformation of peoples address data, requiring a holistic approach that acknowledges the historical injustices in the use of address data. \n\nIt is important we center the discussion of address in the history of how address data and information in the USA on where people live reside are from and their address status (e.g., nonresident, resident, people experiencing homeless) has been for centuries and still is used against people, especially indigenous communities (i.e., displacement, forced relocation), people from black and immigrant communities (e.g., redlining, economic disparities), homeless, and refugee communities. The treatment and use of this data has resulted in limiting people's access to safety and security, as well as learning, work and financial opportunities continuing systemic marginalization based on address and location data and information. \n\nConsiderations around address for indigenous and first nations peoples:\n1. Throughout history, Indigenous and first nations peoples in the USA have faced forced relocation from their ancestral lands, often to reservations or urban areas. Using or treating data on their addresses can serve as a reminder of this history of displacement and the ongoing impacts on Indigenous communities' access to resources and services.\n2. Indigenous communities have voiced concerns about the collection and use of their address data by external entities without their consent or meaningful participation. Address data collection efforts must respect Indigenous principles of data sovereignty, self-determination, and privacy, and involve community engagement.\n3. Address data collected from Indigenous communities may be vulnerable to misuse or discriminatory practices, such as racial profiling by law enforcement or targeting by predatory vendors and service providers. Ensuring the ethical and responsible use of address data is essential to prevent further harm and uphold principles of equity and justice.\n\nConsiderations around address for people experiencing homelessness:\n - Historically, people experiencing homelessness have been stigmatized and marginalized, facing discrimination in housing, employment, and access to services. Collecting data on their addresses can perpetuate this stigma and potentially expose them to further discrimination or harassment.\n- Homeless individuals may have legitimate concerns about the privacy and safety of their personal information, including their addresses. Collecting data on their addresses without adequate safeguards or assurances of confidentiality can further erode their trust in institutions and discourage them from seeking assistance or support services.\n- Someone who is experiencing homelessness should have the opportunity to demonstrate their skills in a manner that is accessible, without having to provide an address or other identifying information, and be able to benefit from LIF in order to help to improve their life circumstances.\n\nConsiderations around address for people from black and immigrant communities:\n- Historically, Black communities have been subject to discriminatory housing practices, including redlining, which systematically denied access to mortgage loans and homeownership opportunities based on race. Collecting data on addresses within these communities may reflect the legacy of segregation and economic disenfranchisement, perpetuating disparities in wealth, housing quality, and access to resources.\n- Immigrant communities, particularly those from marginalized backgrounds, have faced discriminatory policies and practices that restrict their access to housing, employment, education, and healthcare. Collecting data on addresses within immigrant communities may expose individuals and families to heightened surveillance, immigration enforcement, and xenophobic attacks, contributing to feelings of insecurity and fear.\n- Black and immigrant communities are disproportionately targeted for surveillance, policing, and criminalization. Collecting data on addresses within these communities may facilitate racial profiling, discriminatory policing practices, and surveillance technologies, leading to harassment, violence, and incarceration.\n\nGeneral considerations and recommendations:\n- Considering the foundational premise of LIF is intended to serve people from marginalized and underrepresented communities, it is important to recognize that sharing a street address can be sensitive for some people, dignity, respect and compassion should be priority. \n- That address is optional, and not required for a learner to be able to benefit from LIF.  \n- That the format for address adopts a generic international address format, i.e, not US centric to allow for multiple address formats.\n -That people can consent to the use and treatment of address in a manner that is best suited to them, and choosing to not include an address should not preclude a learner from being able to benefit from LIF. \n- If used for research purposes, an explanation about how address will be used, in an accessible manner, and informed manner.	Yes	Yes	\N	1	CM: 2/20: Overall need to consider a more generic Address class, which deviates from the CED-originated approach. See more specific comments below from MP.	\N	\N	\N	\N	LIF	f	\N	f	\N	\N
